import React from 'react';
import { BrowserRouter as Router, Route, Link} from 'react-router-dom';
import TargetList from './TargetList';
import SuppressionList from './SuppresionList';


function Navbar() {
    return (
        <div>
        
        <Router>
             <Route path = "/" component = {TargetList} exact><Link to="/">Target List </Link></Route>
             <Route path = "suppressionList" component = {SuppressionList}><Link to="/suppressionList">SuppressionList </Link></Route>
             
      
       </Router>
       
        </div>
   
    )
}

export default Navbar
